import moment from 'moment';

const currentDate = moment();
let date = currentDate.date();

const schedulerData = [
    { startDate: '2021-06-11T09:45', endDate: '2021-06-11T11:00', title: 'Meeting' },
    {
        startDate: new Date(2021, 6, 11, 12, 0).toDateString(),
        endDate: new Date(2021, 6, 11, 13, 0).toDateString(),
        title: 'Go to a gym'
    },
];

export default schedulerData;
